import React from 'react';
import logo from '../media/ristolina-logo_light.svg';
import './Header.css';
import tachyons from 'tachyons';

const Header = () => {
  return(
    <header class="sans-serif">
      <div class="cover bg-left bg-center-l" id="cover-bg">
        <div class="bg-black-80 pb5 pb6-m pb7-l">
          <nav class="dt w-100 mw8 center">
            <div class="dtc w2 v-mid pa3">
              <a href="/" class="dib w2 h2 pa1 grow-large">
                <img src={logo}></img>
              </a>
            </div>
            <div class="dtc v-mid tr pa3">
              <a class="f6 fw4 hover-white no-underline white-70 dn dib-ns pv2 ph3" href="/" >About</a>
              <a class="f6 fw4 hover-white no-underline white-70 dn dib-ns pv2 ph3" href="/" >Portfolio</a>
              <a class="f6 fw4 hover-white no-underline white-70 dib ml2 pv2 ph3 ba" href="/" >Contact me</a>
            </div>
          </nav>
          <div class="tc-l mt4 mt5-m mt6-l ph3">
            <h1 class="f2 f1-l fw2 white-90 mb0 lh-title">ristolina</h1>
            <h2 class="fw1 f3 white-80 mt3 mb4">A little page about me</h2>
            <a class="f6 no-underline grow dib v-mid white ba b--white ph3 pv2 mb3" href="">Contact me</a>
          </div>
        </div>
      </div>
    </header>
  );

}

export default Header;
